/*This brings in the products and orders data tables to create the date dimension tables*/

CREATE DATABASE `underwear` /*!40100 DEFAULT CHARACTER SET latin1 */ /*!80016 DEFAULT ENCRYPTION='N' */;
USE underwear;

/*Creating and populating 1 dimension table: dim_products*/
CREATE TABLE dim_products(
   ProductID         INTEGER  NOT NULL PRIMARY KEY 
  ,ProductName       VARCHAR(37) NOT NULL
  ,Color             VARCHAR(3)
  ,ModelDescription  VARCHAR(10)
  ,FabricDescription VARCHAR(6)
  ,Category          VARCHAR(21) NOT NULL
  ,Gender            VARCHAR(19) NOT NULL
  ,ProductLine       VARCHAR(9) NOT NULL
  ,Weight            INTEGER  NOT NULL
  ,Size              VARCHAR(5)
  ,PackSize          VARCHAR(11) NOT NULL
  ,Status            VARCHAR(17) NOT NULL
  ,InventoryDate     DATE  NOT NULL
  ,PurchasePrice     NUMERIC(5,2) NOT NULL
);



/*Creating and populating the orders table*/

CREATE TABLE orders(
   OrderID          INTEGER  NOT NULL PRIMARY KEY 
  ,CustomerID       INTEGER  NOT NULL
  ,EmployeeID       INTEGER  NOT NULL
  ,ShippingMethodID INTEGER 
  ,OrderDate        DATE  NOT NULL
  ,ShipDate         DATE  NOT NULL
  ,FreightCharge    NUMERIC(5,2) NOT NULL
);
